i = 0;

$.ajax({
  url: url,
})
.done(function(res) {
  if (res.code == 0) {
    var data = res.data;
    data.forEach(function(item, i) {
      var curr = find(item.nameCn);
      if (curr) {
        curr.link = '/productSearch/list.cf?indusId=' + item.id
        save(curr);
      }

      $.ajax({
        url: middleUrl + '?industryId=' + item.id + '&parentId=0'
      })
      .done(function(res1) {
        if (res1.code == 0) {
          var data1 = res1.data;
          data1.forEach(function(item1, i) {
            var curr1 = find(item1.nameCn);
            if (curr1) {
              curr1.link = '/productSearch/list.cf?categoryId=' + item1.id
              save(curr1);
            }

            $.ajax({
              url: middleUrl + '?industryId=' + item1.industryId + '&parentId=' + item1.id
            })
            .done(function(res2) {
              if (res2.code == 0) {
                var data2 = res2.data;
                data2.forEach(function(item2, i) {
                  var curr2 = find(item2.nameCn);
                  if (curr2) {
                    curr2.link = '/productSearch/list.cf?categoryId=' + item2.id
                    save(curr2);
                  }
                })
              }
            })
          })
        }
      })
    })
  }
});


function find(text) {
  for (var i = cateData.length - 1; i >= 0; i--) {
    if (cateData[i].name == text) {
      return cateData[i]
    }
  }
}

function save(params) {
  $.ajax({
    url: 'http://www.gdp8.com/cms/api/category',
    type: 'post',
    data: params
  })
  .done(function(res) {
    if(1 == res.status) {
      i++
      console.log(params.name, '修改成功')
    }
  })
}
